import React, { useState } from "react";
import Info from "./Info";
import Create from "./Create";

function App() {
  const [messages, setMessages] = useState([]);

  return (
    <div>
      <Create massages={messages} setMessages={setMessages} />
      <Info />
    </div>
  );
}

export default App;
